import React, {useState} from "react";

const App = () => {

  const [item, setItem] = useState("")

  function handleChange(e) {
    setItem(e.target.value)

  }

  return (
    <div >
      <form>
        <label>Add item</label>
        <input 
        type="text" 
        placeholder="item"
        name="item"
        value={item}
        onChange={handleChange}
        />
      </form>

    </div>
  );
}

export default App;
